import React from 'react';
import myImage from './1 (1).jpg';
function HomeInfo() {
  return (
    <>
      <img src={myImage} alt="joel" />
      <p>Learn about Joel Hilton and his awesome movie collection.</p>
    </>
  );
}

export default HomeInfo;
